import React from 'react'
import Button from '@material-ui/core/Button';

const Materialui = () => {
   
    return (
        <>  
            
            <Button color="secondary" size="small" variant="outlined" href="https://material-ui.com/api/button/">click me</Button>
            <Button color="secondary" size="medium" variant="outlined" href="https://material-ui.com/api/button/">click me</Button>
            <Button color="secondary" size="lrage" variant="outlined" href="https://material-ui.com/api/button/">click me</Button>

            <Button onClick={() => { alert('clicked') }}>Click me</Button>

            
           
        </>
    )
}

export default Materialui
